import './App.css';
import ParlayForm from './ParlayForm';
import Report from './Report';
import { useState } from 'react';
import { seedBasic } from './api';

function App() {
  const [tab, setTab] = useState('parlays');

  const handleSeed = async () => {
    try {
      await seedBasic();
      alert('Teams and players seeded successfully!');
    } catch (error) {
      alert('Error seeding data: ' + error.message);
    }
  };

  return (
    <div className="app-container">
      <div className="app-header">
        <h1 className="app-title">üèÄ NBA Parlay Tracker</h1>
        <div className="tab-container">
          <button 
            className="tab-button" 
            onClick={() => setTab('parlays')} 
            disabled={tab === 'parlays'}
          >
            Manage Parlays
          </button>
          <button 
            className="tab-button" 
            onClick={() => setTab('report')} 
            disabled={tab === 'report'}
          >
            Reports & Analytics
          </button>
          <button 
            className="btn-secondary" 
            onClick={handleSeed}
          >
            Seed Teams/Players
          </button>
        </div>
      </div>
      {tab === 'parlays' ? <ParlayForm /> : <Report />}
    </div>
  );
}

export default App;
